import React from 'react';

const PerformanceDate =()=>{
    return <div>
        <h4>Date Details here</h4>
    </div>
}
const KeyResults =()=>{
    return <div>
        <h4>Day's Key Result expectations and outcome here</h4>
    </div>
}

const Performance =()=>{
    return(
        //Use fragment instead of div
        <div>
            <PerformanceDate/>
            <KeyResults/>
            </div>
    );

}

export default Performance;
